--
-- Table structure for table `dog`
--

DROP TABLE IF EXISTS `dog`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `dog` (
  `iddog` int NOT NULL AUTO_INCREMENT,
  `code` varchar(45) DEFAULT NULL,
  `name` varchar(32) NOT NULL,
  `sex` tinyint DEFAULT NULL,
  `breed` int DEFAULT NULL,
  `birth` date DEFAULT NULL,
  `fur` int DEFAULT NULL,
  `marks` varchar(255) DEFAULT NULL,
  `chipnumber` varchar(64) DEFAULT NULL,
  `country` char(3) DEFAULT NULL,
  `sire` int DEFAULT NULL,
  `dam` int DEFAULT NULL,
  PRIMARY KEY (`iddog`),
  KEY `dog-breed_idx` (`breed`),
  KEY `dog-sire_idx` (`sire`),
  KEY `dog-dam_idx` (`dam`),
  KEY `dog-colour_idx` (`fur`),
  KEY `dog-country_idx` (`country`),
  CONSTRAINT `dog-breed` FOREIGN KEY (`breed`) REFERENCES `breed` (`idbreed`),
  CONSTRAINT `dog-colour` FOREIGN KEY (`fur`) REFERENCES `fur` (`idfur`),
  CONSTRAINT `dog-country` FOREIGN KEY (`country`) REFERENCES `country` (`code`),
  CONSTRAINT `dog-dam` FOREIGN KEY (`dam`) REFERENCES `dog` (`iddog`),
  CONSTRAINT `dog-sire` FOREIGN KEY (`sire`) REFERENCES `dog` (`iddog`)
) ENGINE=InnoDB AUTO_INCREMENT=701 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

